import React from 'react';
import Navbar1 from '../Layout/Navbar1';
import { Link } from 'react-router-dom';
import {Container} from 'react-bootstrap';

function Homepage() {
    const backgroundImageUrl="https://www.google.com/url?sa=i&url=https%3A%2F%2Fabzlocal.mx%2Fdetails-200-employee-management-system-background-images-hd%2F&psig=AOvVaw108DN-MPRvcTbw2Pp1CXzK&ust=1679650705504000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCLDJ2Nvg8f0CFQAAAAAdAAAAABAI";

    return (
        <div>
          <Navbar1></Navbar1>
          <Container fluid style={{backgroundImage:'url(${backgroundImageUrl})'}}></Container>
        </div>
    );
}

export default Homepage;
